INSERT INTO `announcements` VALUES (1,'动物城之星投票火热开启！全城齐动员，为你心中的榜样投票！','【ZNN快讯】​ 今日零时，由动物城和谐署与市政厅联合主办的年度盛事——“动物城之星”评选活动正式拉开帷幕！全市投票通道已全面开启，所有市民均可通过爪机客户端或前往各区市政服务中心，为你心中最能代表“任何人都能成就任何事”精神的杰出公民投上宝贵的一票。 \n本届评选旨在表彰过去一年中，为动物城的物种和谐、社区发展与城市繁荣做出卓越贡献的普通市民。据活动主办方介绍，本届提名候选人背景之多元创下历史纪录，充分展现了动物城的活力与包容。 \n\n在最终入围的八位候选人中，我们看到了不同物种、不同职业的杰出代表： \n警局新星、兔窝镇的朱迪·霍普斯警员​ 与其搭档，狐尼克警官，因在“午夜嚎叫”案件中表现出的非凡勇气与智慧，共同获得提名，成为本届最受瞩目的搭档候选人。 \n豹警官在得知自己提名后，被拍到在警局前台激动地吃了十个甜甜圈，并表示“这是压力性进食，是工伤！” \n夏奇羊的全球后援会“羊群”已发动总攻，其粉丝标语“不是一只羊，是整个羊群的力量！”席卷社交媒体。 \n牛局长对此表示：“哞——（深吸一口气）我很欣慰市民们对公共安全的重视超过了娱乐明星。（瞥了一眼夏奇羊的票数）但目前投票才刚刚开始。” \n车管所办事员树懒“闪电”先生……（呃，采访他的提名感言仍在进行中，请耐心等待） \n\n投票流程非常简单。市民只需使用自己的身份ID，即可在官方渠道投票。为鼓励参与，主办方设立了多重好礼：所有投票者均有机会获得由“冰川镇”提供的家庭冰窖体验券，或“撒哈拉广场”的日光浴套餐。 \n“每一票都至关重要！”动物城和谐署发言人在启动仪式上表示，“‘动物城之星’不属于任何个体，它属于我们共同珍视的和谐、勇气与梦想的精神。快来选出最能激励你的那颗星吧！” \n投票将于本月底截止，最终获奖者名单将在下月于“雨林区”举行的盛大颁奖典礼上公布。谁是本届最亮的星？让我们拭目以待！','活动','ALL',0,0,'admin','2025-12-11 16:05:06','2025-12-13 19:30:36'),(2,'动物城交通紧急广播','影响区域：​主城区通往冰川镇的主干道\n紧急路况：因长颈鹿消防队进行高空救援作业，主干道现实施双向临时管制。\n绕行建议：​请所有车辆，尤其是大型车辆，立即绕行撒哈拉广场辅路。\n预计恢复时间：​约30分钟。\n请各位市民听从指挥，耐心避让。感谢您的配合！','交通','冰川镇',1,1,'admin','2025-12-13 20:58:32','2025-12-13 23:46:36');
